import React, { useState } from 'react';
import './Navbar.css';
import { FaBars } from 'react-icons/fa';

const ResponsiveNavbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div>
      <nav className="flex items-center justify-between bg-blue-600 p-4 shadow-md">
        <div className="text-white text-2xl font-bold">CodingNepal</div>
        <div className="md:hidden">
          <button onClick={toggleMenu} className="text-white text-2xl">
            <FaBars />
          </button>
        </div>
        <ul className={`md:flex md:items-center md:space-x-6 absolute md:static bg-blue-600 w-full left-0 md:w-auto md:opacity-100 transition-opacity duration-300 ${isOpen ? 'top-16 opacity-100' : 'top-[-400px] opacity-0'}`}>
          <li><a className="text-white hover:text-gray-300 p-2 block md:inline-block" href="#">Home</a></li>
          <li><a className="text-white hover:text-gray-300 p-2 block md:inline-block" href="#">About</a></li>
          <li><a className="text-white hover:text-gray-300 p-2 block md:inline-block" href="#">Services</a></li>
          <li><a className="text-white hover:text-gray-300 p-2 block md:inline-block" href="#">Contact</a></li>
          <li><a className="text-white hover:text-gray-300 p-2 block md:inline-block" href="#">Feedback</a></li>
        </ul>
      </nav>
      <section className="h-screen bg-gray-100"></section>
    </div>
  );
};

export default ResponsiveNavbar;
